        // Define renderCarList globally
        function renderCarList(cars) {
            var carListContainer = $('#CarListingDesktop__carListingDesktopWrapper');
            carListContainer.empty(); // Clear existing content

            // Check if there are cars to display
            if (cars.length > 0) {
                // Loop through each car in the data and append HTML to the container
                var carCounter = 0; // Counter variable
                cars.forEach(function(car) {
                    var carHTML = generateCarHTML(car);
                    carListContainer.append(carHTML);
                    carCounter++;

                    // Display the car count in the heading
                    $('.HeadingContent__count').text(carCounter + " results found");
                });
            } else {
                // Display a message when no cars are found
                carListContainer.append('<p>No cars found near your location.</p>');
            }
        }

        // Use the URLSearchParams API to get query parameters from the URL
        const urlParams = new URLSearchParams(window.location.search);
        const city = urlParams.get('city_id');
        const start_date = urlParams.get('start_date');
        const end_date = urlParams.get('end_date');

        // Make AJAX request to your Django API endpoint
