        async function getAvailableCars() {
    const cityId = $('#city').val();
    const dateRange = $('#rental_dates span').text();

    const [start_date, end_date] = dateRange.split(' — ');

    const formattedStartDate = moment(start_date, 'MMMM D, YYYY').format('YYYY-MM-DD');
    const formattedEndDate = moment(end_date, 'MMMM D, YYYY').format('YYYY-MM-DD');

    const numberOfDays = moment(formattedEndDate).diff(formattedStartDate, 'days')
    // Show loading message
    showLoadingMessage();

    const urlParams = new URLSearchParams(window.location.search);
    urlParams.set('city_id', cityId);
    urlParams.set('start_date', formattedStartDate);
    urlParams.set('end_date', formattedEndDate);

    history.replaceState({}, '', `${window.location.pathname}?${urlParams.toString()}`);

    const url = `/get_available_cars/?city_id=${encodeURIComponent(cityId)}&start_date=${encodeURIComponent(formattedStartDate)}&end_date=${encodeURIComponent(formattedEndDate)}`;

    try {
        const response = await fetch(url);
        const data = await response.json();

        // Hide loading message
        hideLoadingMessage();

        const carListContainer = $('#CarListingDesktop__carListingDesktopWrapper');
        carListContainer.empty();

        let carCounter = 0;

        data.cars.forEach(availableCar => {
            const carHTML = generateCarHTML(availableCar);
            carListContainer.append(carHTML);
            carCounter++;

            $('.HeadingContent__count').text(carCounter + " results found");

            carListContainer.on('click', `.open-modal[data-car-id="${availableCar.id}"]`, (event) => {
                event.preventDefault();
                openCarModal(cityId, availableCar.id, formattedStartDate, formattedEndDate, numberOfDays);
            });
        });
    } catch (error) {
        console.error('Error fetching data:', error);
        // Handle the error, e.g., show an error message to the user
        hideLoadingMessage(); // Make sure to hide the loading message even if an error occurs
    }
}

function showLoadingMessage() {
    // Show your loading message
    $('#loading-message').text('Loading...').show();
}

function hideLoadingMessage() {
    // Hide your loading message
    $('#loading-message').hide();
}


