        // Function to update UI for a specific item
    function updateUI(itemContainer) {
        // Get the checkbox within the container
        var checkbox = itemContainer ? itemContainer.querySelector('.vue-checkbox-input input') : null;

        // Log the checkbox to the console
        console.log("Checkbox:", checkbox);

        // Get the itemId dynamically from the checkbox data attribute
        var itemId = checkbox ? checkbox.dataset.checkboxFor : null;
        console.log("ItemId:", itemId);

        // Exit if itemId is not available
        if (!itemId) {
            console.error("itemId not found");
            return;
        }

        // Get the price per unit dynamically from the checkbox data attribute
        var pricePerUnit = parseFloat(checkbox.dataset.pricePerUnit);
        console.log("Price Per Unit:", pricePerUnit);

        // Exit if pricePerUnit is not a valid number
        if (isNaN(pricePerUnit)) {
            console.error("Invalid pricePerUnit");
            return;
        }

        // Get other elements within the container
        var quantityDisplay = itemContainer.querySelector(".quantity-display");

        // Check if the quantityDisplay element is null
        if (quantityDisplay) {
            // Initial quantity value
            var quantity = parseInt(quantityDisplay.innerText) || 0;

            // Update quantity display
            quantityDisplay.innerText = quantity;

            // Update checkbox status
            checkbox.checked = quantity > 0;

            // Calculate and update total price
            var amountElement = itemContainer.querySelector(".extra-item-amount-show");
            var totalPrice = quantity * pricePerUnit;
            amountElement.innerText = totalPrice + "$";

        } else {
            console.error("Quantity display element not found");
        }

        // If the checkbox is checked, add/update the item in the selected items list
        if (checkbox.checked) {
            addToSelectedItemsList(itemId, quantity, pricePerUnit);
        } else {
            removeFromSelectedItemsList(itemId);
        }
    }

function addToSelectedItemsList(itemId, quantity, pricePerUnit) {
            var selectedItemsList = document.getElementById("selectedItemsList");
            var existingItem = selectedItemsList.querySelector(`[data-item-id="${itemId}"]`);

            if (existingItem) {
                // If the item already exists, update the quantity and total price
                var newQuantity = parseInt(existingItem.dataset.quantity) + 1;

                // Update the quantity in the dataset
                existingItem.dataset.quantity = newQuantity;

                // Update the display
                existingItem.textContent = `Item ID: ${itemId}, Quantity: ${newQuantity}, Total Price: ${newQuantity * pricePerUnit}$`;
            } else {
                // If the item does not exist, create a new list item
                var listItem = document.createElement("li");
                listItem.textContent = `Item ID: ${itemId}, Quantity: 1, Total Price: ${pricePerUnit}$`;
                listItem.dataset.itemId = itemId;
                listItem.dataset.quantity = quantity;

                // Append the new item to the list
                selectedItemsList.appendChild(listItem);
            }
        }

        function removeFromSelectedItemsList(itemId) {
            var selectedItemsList = document.getElementById("selectedItemsList");
            var itemsToRemove = selectedItemsList.querySelectorAll(`[data-item-id="${itemId}"]`);
            if (itemsToRemove) {
                // If the item already exists, update the quantity and total price
                var newQuantity = parseInt(existingItem.dataset.quantity) - 1;

                // Update the quantity in the dataset
                existingItem.dataset.quantity = newQuantity;

                // Update the display
                existingItem.textContent = `Item ID: ${itemId}, Quantity: ${newQuantity}, Total Price: ${newQuantity * pricePerUnit}$`;
            }
            itemsToRemove.forEach(function (item) {
                item.remove();
            });
        }

