document.addEventListener('DOMContentLoaded', function () {
    // Use event delegation to handle clicks on dynamic elements
    document.addEventListener('click', function (event) {
        var clickedElement = event.target;

        // Check if the clicked element has the desired class
        if (clickedElement.classList.contains('ProductDesktop__sectionItem')) {
            // Remove the 'active' class from all tabs
            document.querySelectorAll('.ProductDesktop__sectionItem').forEach(function (item) {
                item.classList.remove('ProductDesktop__active');
            });

            // Add the 'active' class to the clicked tab
            clickedElement.classList.add('ProductDesktop__active');

            // Get the target section ID
            var targetSectionId = clickedElement.getAttribute('data-label');

            // Scroll to the target section
            document.getElementById(targetSectionId).scrollIntoView({
                behavior: 'smooth'
            });
        }
    });
});






